import React, { useState } from 'react';
import { Route, Routes, useNavigate } from 'react-router-dom';
import CompanyRegister from './CompanyRegister';
import CompanyLogin from './companylogin';
import StudentPage from './studentpage';
import SCADPage from './scadpage';
import CompanyPage from './companypage';
import FacultyPage from './facultypage';

function App() {
  // Dummy users for login
  const dummyUsers = [
    {
      role: 'student',
      email: 'student@example.com',
      password: 'student123',
    },
    {
      role: 'scad',
      email: 'scad@example.com',
      password: 'scad123',
    },
    {
      role: 'faculty',
      email: 'faculty@example.com',
      password: 'faculty123',
    },
  ];

  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [emailError, setEmailError] = useState('');
  const [passwordError, setPasswordError] = useState('');
  const navigate = useNavigate();

  // Handle form submission for login
  const handleLogin = (e) => {
    e.preventDefault();
    let valid = true;

    // Reset previous errors
    setEmailError('');
    setPasswordError('');

    // Validate email
    const user = dummyUsers.find(
      (u) => u.email === email && u.password === password
    );

    // Check if the user is a registered company
    const companies = JSON.parse(localStorage.getItem('companies')) || [];
    const companyUser = companies.find(
      (c) => c.companyEmail === email && c.password === password
    );

    if (!user && !companyUser) {
      valid = false;
      setEmailError('Invalid email or password');
      setPasswordError('Invalid email or password');
    } else if (user) {
      alert(`Logged in as ${user.role}`);
      navigate(`/${user.role}page`);
    } else if (companyUser) {
      alert(`Logged in as company: ${companyUser.companyName}`);
      navigate('/companypage');
    }

    return valid;
  };

  const handleCompanyRegister = () => {
    navigate('/company-register');
  };

  return (
    <div>
      <Routes>
        {/* Login Page */}
        <Route
          path="/"
          element={
            <div style={{ display: 'flex', justifyContent: 'center', alignItems: 'center', height: '100vh' }}>
              <div style={{ padding: '20px', border: '1px solid #ddd', borderRadius: '8px' }}>
                <h2>Login</h2>
                <form onSubmit={handleLogin}>
                  <div>
                    <label htmlFor="email">Email:</label>
                    <input
                      type="email"
                      id="email"
                      name="email"
                      value={email}
                      onChange={(e) => setEmail(e.target.value)}
                      required
                      placeholder="Enter your email"
                      style={{
                        width: '100%',
                        padding: '8px',
                        marginBottom: '10px',
                        borderColor: emailError ? 'red' : '',
                      }}
                    />
                    {emailError && <div style={{ color: 'red', fontSize: '12px' }}>{emailError}</div>}
                  </div>
                  <div>
                    <label htmlFor="password">Password:</label>
                    <input
                      type="password"
                      id="password"
                      name="password"
                      value={password}
                      onChange={(e) => setPassword(e.target.value)}
                      required
                      placeholder="Enter your password"
                      style={{
                        width: '100%',
                        padding: '8px',
                        marginBottom: '10px',
                        borderColor: passwordError ? 'red' : '',
                      }}
                    />
                    {passwordError && <div style={{ color: 'red', fontSize: '12px' }}>{passwordError}</div>}
                  </div>
                  <div style={{ display: 'flex', flexDirection: 'column', gap: '10px' }}>
                    <button
                      type="submit"
                      style={{
                        padding: '10px',
                        backgroundColor: '#4CAF50',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                      }}
                    >
                      Login
                    </button>
                    <button
                      type="button"
                      onClick={handleCompanyRegister}
                      style={{
                        padding: '10px',
                        backgroundColor: '#FFA500',
                        color: 'white',
                        border: 'none',
                        borderRadius: '4px',
                      }}
                    >
                      Register as a Company
                    </button>
                  </div>
                </form>
              </div>
            </div>
          }
        />

        {/* Other Pages */}
        <Route path="/company-register" element={<CompanyRegister />} />
        <Route path="/company-login" element={<CompanyLogin />} />
        <Route path="/studentpage" element={<StudentPage />} />
        <Route path="/scadpage" element={<SCADPage />} />
        <Route path="/companypage" element={<CompanyPage />} />
        <Route path="/facultypage" element={<FacultyPage />} />
      </Routes>
    </div>
  );
}

export default App;
